    <main>
        <!-- Hero Section -->
        <section class="text-center py-20 px-4 md:px-8">
            <h1 class="text-5xl md:text-6xl font-bold text-hunter-green leading-tight mb-4 animate-pulse">Our Story, Your Journey</h1>
            <p class="text-xl text-gray-600 max-w-2xl mx-auto">HealSpace was created with a simple, powerful vision: to make mental wellness accessible and stigma-free for everyone, everywhere.</p>
        </section>

        <!-- Mission & Vision Section -->
        <section class="bg-light-gray py-20 px-4 md:px-8">
            <div class="container mx-auto grid md:grid-cols-2 gap-12 items-center">
                <div class="order-2 md:order-1">
                    <h2 class="text-3xl font-bold text-hunter-green mb-4">Our Mission</h2>
                    <p class="text-lg text-gray-700 leading-relaxed mb-6">
                        We believe that mental health care is a fundamental right, not a luxury. Our mission is to provide a safe, secure, and supportive online platform where individuals can connect with compassionate, qualified therapists from the comfort of their homes. We are dedicated to breaking down barriers of access, cost, and social stigma.
                    </p>
                    <h2 class="text-3xl font-bold text-hunter-green mb-4 mt-8">Our Vision</h2>
                    <p class="text-lg text-gray-700 leading-relaxed">
                        To build a world where seeking therapy is as normal as going to the gym. We envision a future where everyone has the tools and support they need to navigate life's challenges, thrive, and contribute to a healthier, happier community.
                    </p>
                </div>
                <div class="order-1 md:order-2 flex justify-center">
                    <!-- Placeholder SVG for visual appeal -->
                    <svg class="w-full h-auto max-w-md text-hunter-green" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round">
