            <div class="container mx-auto">
                <h2 class="text-4xl font-bold text-hunter-green mb-10">Words of Encouragement</h2>
                <div class="bg-hunter-green text-white p-10 rounded-3xl shadow-xl max-w-4xl mx-auto transition-transform duration-300 transform scale-100">
                    <p id="quote-display" class="text-2xl md:text-3xl italic mb-6 leading-relaxed">
